void printIconData(char *filename) {
    int x, y, n;
    unsigned char *data = stbi_load(filename, &x, &y, &n, 0);
    if (!data) {
        fprintf(stderr, "error opening slack icon");
        return;
    }
    printf("%d, %d,\n", x, y);
    for (int row = 0; row < y; row++) {
        for (int col = 0; col < x; col++) {
            int off = row * x * 4 + col * 4;
            printf("0x");
            printf("%02x", data[off + 3]);
            printf("%02x", data[off + 0]);
            printf("%02x", data[off + 1]);
            printf("%02x", data[off + 2]);
            printf(", ");
        }
        printf("\n");
    }
    stbi_image_free(data);
}

char *getWindowName(Display *display, Window w) {
    Atom real;
    int format;
    unsigned long n;
    unsigned long extra;
    unsigned char *xname;
    int err = XGetWindowProperty(display, w, XA_WM_NAME, 0, ~0, False, AnyPropertyType, &real, &format, &n, &extra, &xname);
    if (err != Success || real == None) {
        return NULL;
    }
    char *name = malloc(strlen((char *)xname) + 1);
    strcpy(name, (char *)xname);
    XFree(xname);
    return name;
}

Window findSlackWindow(Display *display, Window w) {
    Window root;
    Window parent;
    Window *children;
    unsigned int nchildren;
    Status status = XQueryTree(display, w, &root, &parent, &children, &nchildren);
    if (status == 0) {
        printf("XQueryTree failed\n");
        return 0;
    }
    for (unsigned int i = 0; i < nchildren; i++) {
        Window child = children[i];
        char *pre = "Slack -";
        char *name = getWindowName(display, child);
        bool found = name && strncmp(pre, name, strlen(pre)) == 0;
        if (name) {
            free(name);
        }
        if (found) {
            return child;
        }
        Window slack = findSlackWindow(display, child);
        if (slack) {
            return slack;
        }
    }
    return 0;
}

